text199635.addInnerText('<div id=\"text199635\" aria-hidden=\"true\" ><table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:10px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text199635Font1\"  >To establish a trend, you will need historical data. This is done in the Reports Workspace of FSIMS and the further back you look at the data, the more reliable will the trend be. Because it is a rather new aircraft, the available data for the CH147F only goes back to 2014. This search shows that the highest number of CH147F bird strikes for a year is six and that it occurred in 2019 it also shows that this year\'s current number is five.\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');

text200456.addInnerText('<div id=\"text200456\" aria-hidden=\"true\" ><table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:10px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text200456Font1\"  >But bird strikes are not limited to a single aircraft type, and you know that 427 SOAS flies the CH146 on the other side of the airport. So, you modify your report to include the CH146 for the same period. You notice that 32 was the highest number for the CH146 and was also reported in 2019.\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
